import{_ as e}from"./chunks/pdf.ootvOnpX.js";import{_ as i,c as a,a1 as r,o as t}from"./chunks/framework.xETXYpcG.js";const p=JSON.parse('{"title":"Master thesis","description":"","frontmatter":{"prev":false,"next":false,"image":"leuven.jpg","caption":"Leuven, Belgium, May 2017"},"headers":[],"relativePath":"teaching/masterthesis/index.md","filePath":"teaching/masterthesis/index.md"}'),l={name:"teaching/masterthesis/index.md"};function n(o,s,m,h,u,d){return t(),a("div",null,s[0]||(s[0]=[r('<h1 id="master-thesis" tabindex="-1">Master thesis <a class="header-anchor" href="#master-thesis" aria-label="Permalink to &quot;Master thesis&quot;">​</a></h1><p>This page lists all the <strong>master thesis</strong> that I supervised. Reports that are not confidential can be downloaded from this page.</p><h2 id="other" tabindex="-1">Other <a class="header-anchor" href="#other" aria-label="Permalink to &quot;Other&quot;">​</a></h2><p>With the roles I have in different <strong>companies or institutions</strong>, I had the opportunity to supervise several master thesis connected to my activities related to these roles.</p><ol><li>Ilias El-Abbassi. Projet MyPress - Développement d&#39;un système de centralisation d&#39;accès à la presse en ligne. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2020. <a href="/files/publi/el-abbassi-master-thesis-2020.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Louis de Viron (DataText, Schaerbeek).</small></li><li>Houda Hannouni. Cartographie de concepts informatiques et développement d&#39;un outil de recherche multiparadigmes. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2020. <a href="/files/publi/hannouni-master-thesis-2020.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Dr Sébastien Combéfis (EDITx, Etterbeek).</small></li><li>Julien Kessels. Mise en place d’un tutoriel intelligent et d&#39;outils d&#39;aide à la création de questions d&#39;examens par des algorithmes de machine learning. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2019. <a href="/files/publi/kessels-master-thesis-2019.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Dr Sébastien Combéfis (EDITx, Etterbeek).</small></li><li>Amaury Lekens. Système de prédiction des niveaux de compétence IT de programmeurs par machine learning. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2019. <a href="/files/publi/lekens-master-thesis-2019.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Dr Sébastien Combéfis (EDITx, Etterbeek).</small></li></ol><h2 id="centre-de-recherche-et-de-developpement-de-l-ecam" tabindex="-1">Centre de Recherche et de Développement de l&#39;ECAM <a class="header-anchor" href="#centre-de-recherche-et-de-developpement-de-l-ecam" aria-label="Permalink to &quot;Centre de Recherche et de Développement de l&#39;ECAM&quot;">​</a></h2><p>When I was a <strong>researcher</strong> at the <a href="https://www.cerdecam.be" target="_blank" rel="noreferrer">Centre de Recherche et de Développement de l&#39;ECAM</a> (CERDECAM) from 2018 to 2020, I supervised several master thesis, whether as part of research projects in which I am involved or as a coach for the student entrepreneur program.</p><ol start="5"><li>Sam Bertrand. Designing an Internet of Things device to geolocate people outside a perimeter in the NeoFinder startup project frame. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2020. <a href="/files/publi/bertrand-master-thesis-2020.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Queenie Halsberghe (CERDECAM, Woluwé-Saint-Lambert).</small></li><li>Martin Degeldt. Design, conception et déploiement d&#39;une solution full-stack de gestion de données de géolocalisation pour la startup NeoFinder. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2020. <a href="/files/publi/degeldt-master-thesis-2020.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Queenie Halsberghe (CERDECAM, Woluwé-Saint-Lambert).</small></li><li>Gaétan Guru. Design and Implementation of a Social Networks Analysis Framework Combining the Neo4j Graph Database and the Python Programming Language. <em>Master Thesis</em>. ECAM Brussels Engineering School, Belgium, June 2019. <a href="/files/publi/guru-master-thesis-2019.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Dr Sébastien Combéfis (CERDECAM, Woluwé-Saint-Lambert).</small></li></ol><h2 id="ecam-brussels-engineering-school" tabindex="-1">ECAM Brussels Engineering School <a class="header-anchor" href="#ecam-brussels-engineering-school" aria-label="Permalink to &quot;ECAM Brussels Engineering School&quot;">​</a></h2><p>When I was a <strong>lecturer</strong> at the <a href="https://www.ecam.be" target="_blank" rel="noreferrer">ECAM Brussels Engineering School</a> (ECAM) from 2014 to 2020, I supervised several master thesis. Most of them took place in a company outside the school and are in the continuity of the <a href="./../internships/supervision/">work placement internship</a> that took place during the first semester.</p><ol start="8"><li>Hadrien Hachez. The stock replenishment through the machine learning. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2020. <a href="/files/publi/hachez-master-thesis-2020.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Patrick Tack (Avanade, Brussels).</small></li><li>Saïkou Ahmadou Barry. Design, implémentation, benchmark et études budgétaires d&#39;une architecture pour l&#39;ingestion de données IoT au sein de la plateforme Shayp. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, January 2020. <a href="/files/publi/barry-master-thesis-2020.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Ir. Grégoire de Hemptinne (Shayp, Etterbeek).</small></li><li>Tom Selleslagh. Réalisation d&#39;une architecture IoT distribuée autonome basée sur les concepts de micro-services. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2019. <a href="/files/publi/selleslagh-master-thesis-2019.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Ir. Laurent Deru (CETIC, Charleroi).</small></li><li>Yannick Berckmans. Boitier électronique IoT de monitoring énergétique : Étude et programmation d&#39;un prototype. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2018.<br><small>Advisor: Ing. Michaël Jeanmotte (G.M. Electronics, Ganshoren).</small></li><li>Antoine Vander Meiren. Développement de l&#39;entièreté de la chaine d&#39;une solution de chiffrement sur Android basée sur un module hardware spécialisé. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2018.<br><small>Advisor: Ir. Samuel Tessian (Thalès, Tubize).</small></li><li>Charles Vandevoorde. Hybrid ordering protocol for partially-replicated state machine. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2018. <a href="/files/publi/vandevoorde-master-thesis-2018.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Prof. Peter Van Roy (Université catholique de Louvain, UCLouvain).</small></li><li>Damien Vanhove. Design, développement et intégration à une plateforme de gestion d&#39;école d&#39;un module de gestion des stages. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), ECAM, September 2017. <a href="/files/publi/vanhove-master-thesis-2017.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Dr Sébastien Combéfis (ECAM Brussels Engineering School, Woluwé-Saint-Lambert).</small></li><li>Benoit de Patoul. Post-Wildfire Vegetation Loss Mapping using Bitemporal Synthetic Aperture Radar. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2017. <a href="/files/publi/de-patoul-master-thesis-2017.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Dr Zhi Qiang Chen (University of Missouri-Kansas City, UMKC).</small></li><li>Lionel Gosselin. Création d&#39;un service Fablab pour la conception et l&#39;impression 3D au sein de l&#39;ECAM. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2016.<br><small>Advisor: Ir. Cédric Marchand (CERDECAM, Woluwé-Saint-Lambert).</small></li><li>Damien Vanhove. Développement d&#39;un outil d&#39;analyse de la topologie d&#39;un réseau informatique industriel. <em>Master Thesis</em>. ECAM Brussels Engineering School (ECAM), Belgium, June 2016.<br><small>Advisor: Ir. Serge Wautier (eWon, Nivelles).</small></li></ol><h2 id="universite-catholique-de-louvain" tabindex="-1">Université catholique de Louvain <a class="header-anchor" href="#universite-catholique-de-louvain" aria-label="Permalink to &quot;Université catholique de Louvain&quot;">​</a></h2><p>When I was working as a <strong>teaching assistant</strong> at the <a href="https://www.uclouvain.be/en" target="_blank" rel="noreferrer">Université catholique de Louvain</a> (UCLouvain) from 2007 to 2014, I supervised several master thesis, as a supervisor or co-advisor. The topics were related to my own PhD thesis or to other projects I was working on at that time.</p><ol start="18"><li>Steven An. Extending Pythia with structural source code checks for Java. <em>Master Thesis</em>. Université catholique de Louvain (UCLouvain), Belgium, September 2014. <a href="/files/publi/an-master-thesis-2014.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Prof. Kim Mens, Co-Advisor: Dr Sébastien Combéfis.</small></li><li>Pierre Bouilliez. Glass Cat — a tool for interactive visualization of the execution of Oz programs in the Pythia platform. <em>Master Thesis</em>. Université catholique de Louvain (UCLouvain), Belgium, June 2014. <a href="/files/publi/bouilliez-master-thesis-2014.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Prof. Peter Van Roy, Co-Advisor: Dr Sébastien Combéfis.</small></li><li>Pierre Nauw. Outils d&#39;analyse de modèles de systèmes interactifs ADEPT. <em>Master Thesis</em>. Université catholique de Louvain (UCLouvain), Belgium, June 2014. <a href="/files/publi/nauw-master-thesis-2014.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Prof. Charles Pecheur, Co-Advisor: Dr Sébastien Combéfis.</small></li><li>Simon Goffin. Analyse Comparative de Formalismes d&#39;Interfaces Homme-Machine. <em>Master Thesis</em>. Université catholique de Louvain (UCLouvain), Belgium, June 2012. <a href="/files/publi/goffin-master-thesis-2012.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisors: Prof. Charles Pecheur and Prof. Jean Vanderdonckt.</small></li><li>Olivier Goletti. Modeling Operation Errors by Model Mutation. <em>Master Thesis</em>. Université catholique de Louvain (UCLouvain), Belgium, June 2011. <a href="/files/publi/goletti-master-thesis-2011.pdf" target="_blank"><img src="'+e+'" alt="PDF"></a><br><small>Advisor: Prof. Charles Pecheur.</small></li></ol>',14)]))}const f=i(l,[["render",n]]);export{p as __pageData,f as default};
